// Timeline.js
import React from 'react';

const moments = [
  { year: 2025, title: 'Awal Tahun', desc: 'Kita mulai tahun ini dengan penuh semangat.' },
  { year: 2025, title: 'Momen Spesial', desc: 'Banyak cerita dan tawa yang kita bagi.' },
  { year: 2025, title: 'Akhir Tahun', desc: 'Menutup tahun dengan harapan baru.' },
];

function Timeline() {
  return (
    <section style={{margin: '2rem 0'}}>
      <h2>Journey Map 2025</h2>
      <ul style={{listStyle: 'none', padding: 0}}>
        {moments.map((m, i) => (
          <li key={i} style={{margin: '1rem 0', padding: '1rem', background: '#23272f', borderRadius: '8px'}}>
            <strong>{m.title}</strong> <span style={{color: '#aaa'}}>({m.year})</span>
            <div>{m.desc}</div>
          </li>
        ))}
      </ul>
    </section>
  );
}

export default Timeline;
